import React, { useState, useEffect } from 'react';
import ReactFlow, { MiniMap, Controls, Background } from 'react-flow-renderer';
import './App.css';

const API_BASE_URL = 'http://localhost:3001/api';

// Custom node types
const customNodeTypes = {
  Customer: ({ data }) => (
    <div className="custom-node customer-node">
      <strong>{data.Type}: {data.ID}</strong>
      <div>Name: {data.data.FirstName} {data.data.LastName}</div>
      <div>Email: {data.data.Email}</div>
    </div>
  ),
  'Counter-Party': ({ data }) => (
    <div className="custom-node counter-party-node">
      <strong>{data.Type}: {data.ID}</strong>
    </div>
  ),
  Business: ({ data }) => (
    <div className="custom-node business-node">
      <strong>{data.Type}: {data.ID}</strong>
    </div>
  ),
};

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [allGroups, setAllGroups] = useState([]);
  const [selectedGroup, setSelectedGroup] = useState(null);
  const [groupDetails, setGroupDetails] = useState(null);
  const [graphData, setGraphData] = useState(null);
  const [elements, setElements] = useState([]);
  useEffect(() => {
    fetchAllGroups();
  }, []);

  const fetchAllGroups = async () => {
    try {
      const response = await fetch(`${API_BASE_URL}/groups`);
      const data = await response.json();
      setAllGroups(Array.isArray(data) ? data : []);
    } catch (error) {
      console.error('Failed to fetch all groups:', error);
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(`${API_BASE_URL}/groups/search?term=${searchTerm}`);
      const data = await response.json();
      setSearchResults(Array.isArray(data) ? data : []);
    } catch (error) {
      console.error('Failed to search groups:', error);
    }
  };

  const handleGroupSelect = async (groupId) => {
    setSelectedGroup(groupId);
    try {
      const [detailsResponse, graphResponse] = await Promise.all([
        fetch(`${API_BASE_URL}/groups/${groupId}`),
        fetch(`${API_BASE_URL}/groups/${groupId}/graph`)
      ]);
      const details = await detailsResponse.json();
      const graph = await graphResponse.json();
      setGroupDetails(details);
      setGraphData(graph);
    } catch (error) {
      console.error('Failed to fetch group data:', error);
    }
  };
  useEffect(() => {
    if (graphData) {
      const flowElements = [
        ...graphData.nodes.map(node => ({
          id: node.id,
          type: node.type,
          data: node.data,
          position: { x: Math.random() * 500, y: Math.random() * 500 },
        })),
        ...graphData.edges
      ];
      setElements(flowElements);
    }
  }, [graphData]);

  return (
    <div className="app-container">
      <header className="app-header">
        <h1>Entity Resolution System</h1>
      </header>
      <div className="app-content">
        <div className="search-panel">
          <form onSubmit={handleSearch}>
            <input
              type="text"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              placeholder="Search groups..."
              className="search-input"
            />
            <button type="submit" className="search-button">Search</button>
          </form>
          <div className="group-list">
            <h3>All Groups</h3>
            {allGroups.map(groupId => (
              <div 
                key={groupId} 
                onClick={() => handleGroupSelect(groupId)} 
                className={`group-item ${selectedGroup === groupId ? 'selected' : ''}`}
              >
                {groupId}
              </div>
            ))}
          </div>
          {searchResults.length > 0 && (
            <div className="search-results">
              <h3>Search Results</h3>
              {searchResults.map(groupId => (
                <div 
                  key={groupId} 
                  onClick={() => handleGroupSelect(groupId)} 
                  className={`search-result-item ${selectedGroup === groupId ? 'selected' : ''}`}
                >
                  {groupId}
                </div>
              ))}
            </div>
          )}
        </div>
          <div className="visualization-panel">
          {elements.length > 0 ? (
            <ReactFlow 
              elements={elements}
              nodeTypes={customNodeTypes}
              style={{ width: '100%', height: '600px' }}
            >
              <MiniMap />
              <Controls />
              <Background color="#aaa" gap={16} />
            </ReactFlow>
          ) : (
            <p>Select a group to view its visualization</p>
          )}
        </div>
        <div className="details-panel">
          <h2>Group Details</h2>
          {groupDetails ? (
            <pre>{JSON.stringify(groupDetails, null, 2)}</pre>
          ) : (
            <p>Select a group to view details</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
